import React,{useState,useEffect} from 'react'
import { Link } from 'react-router-dom'
import AdminShajiDash from './AdminShajiDash'
import { getOrdersAdmin } from './help/AddCategory'

export default function AdminShajiDashOrders() {
    const [error, seterror] = useState(false)
    const [orders, setorders] = useState("")
    const errorHandler = () => {
        if(error){
            return(
                <div class="alert alert-danger" role="alert">
                Sorry Admin some error happened !!!
              </div>
            )
          
        }
    }
    useEffect(() => {
        allOrdersToday()
    }, [])
    const allOrdersToday = () => {
        getOrdersAdmin().then(res => {
            if(res.error){
                seterror(true)
                
            }
            console.log(res);
            setorders(res)
        })
    }
    return (
        <AdminShajiDash>
            {errorHandler()}
            <h6>{JSON.stringify(orders)}</h6>
        </AdminShajiDash>
    )
}
